/* name: conslike
 * function(xx) */
static inline int lcf2_conslike(lua_State *L) {
  enum { lc_nformalargs = 1 };
  lua_settop(L, 1);

  /* xx[1 + 1] = force_all_rec(xx[1 + 1]) */
  lc_getupvalue(L, lua_upvalueindex(1), 6, 59);
  lua_pushnumber(L, 2);
  lua_gettable(L, 1);
  lua_call(L, 1, 1);
  lua_pushnumber(L, 2);
  lua_insert(L, -2);
  lua_settable(L, 1);
  assert(lua_gettop(L) == 1);

  /* xx[2 + 1] = force_all_rec(xx[2 + 1]) */
  lc_getupvalue(L, lua_upvalueindex(1), 6, 59);
  lua_pushnumber(L, 3);
  lua_gettable(L, 1);
  lua_call(L, 1, 1);
  lua_pushnumber(L, 3);
  lua_insert(L, -2);
  lua_settable(L, 1);
  assert(lua_gettop(L) == 1);

  /* if comment_p(xx[1 + 1]) or comment_p(xx[2 + 1]) then */
  enum { lc496 = 1 };
  lc_getupvalue(L, lua_upvalueindex(1), 6, 98);
  lua_pushnumber(L, 2);
  lua_gettable(L, 1);
  lua_call(L, 1, 1);
  if (!(lua_toboolean(L, -1))) {
    lua_pop(L, 1);
    lc_getupvalue(L, lua_upvalueindex(1), 6, 98);
    lua_pushnumber(L, 3);
    lua_gettable(L, 1);
    lua_call(L, 1, 1);
  }
  const int lc497 = lua_toboolean(L, -1);
  lua_pop(L, 1);
  if (lc497) {

    /* local ret = lang_copy_do(xx) */
    lc_getupvalue(L, lua_upvalueindex(1), 6, 54);
    lua_pushvalue(L, 1);
    lua_call(L, 1, 1);
    assert(lua_gettop(L) == 2);

    /* local a = xx[1 + 1] */
    lua_pushnumber(L, 2);
    lua_gettable(L, 1);
    assert(lua_gettop(L) == 3);

    /* local d = xx[2 + 1] */
    lua_pushnumber(L, 3);
    lua_gettable(L, 1);
    assert(lua_gettop(L) == 4);

    /* local a1 = force_uncomment_all_rec(a) */
    lc_getupvalue(L, lua_upvalueindex(1), 0, 137);
    lua_pushvalue(L, 3);
    lua_call(L, 1, 1);
    assert(lua_gettop(L) == 5);

    /* local d1 = force_uncomment_all_rec(d) */
    lc_getupvalue(L, lua_upvalueindex(1), 0, 137);
    lua_pushvalue(L, 4);
    lua_call(L, 1, 1);
    assert(lua_gettop(L) == 6);

    /* ret[1 + 1] = a1 */
    lua_pushvalue(L, 5);
    lua_pushnumber(L, 2);
    lua_insert(L, -2);
    lua_settable(L, 2);
    assert(lua_gettop(L) == 6);

    /* ret[2 + 1] = d1 */
    lua_pushvalue(L, 6);
    lua_pushnumber(L, 3);
    lua_insert(L, -2);
    lua_settable(L, 2);
    assert(lua_gettop(L) == 6);

    /* return ret */
    lua_pushvalue(L, 2);
    return 1;
    assert(lua_gettop(L) == 6);
  } else {

    /* else
     * return xx */
    lua_pushvalue(L, 1);
    return 1;
    assert(lua_gettop(L) == 1);
  }
  lua_settop(L, lc496);
  assert(lua_gettop(L) == 1);
  return 0;
}

