/* name: inner_bracket
 * function(vl) */
static inline int lcf1_inner_bracket(lua_State *L) {
  enum { lc_nformalargs = 1 };
  lua_settop(L, 1);

  /* if is_inner_bool then */
  enum { lc1024 = 1 };
  lc_getupvalue(L, lua_upvalueindex(1), 0, 195);
  const int lc1025 = lua_toboolean(L, -1);
  lua_pop(L, 1);
  if (lc1025) {

    /* return "[" .. tostring(vl) .. "]" */
    lua_pushliteral(L, "[");
    lua_getfield(L, LUA_ENVIRONINDEX, "tostring");
    lua_pushvalue(L, 1);
    lua_call(L, 1, 1);
    lua_pushliteral(L, "]");
    lua_concat(L, 2);
    lua_concat(L, 2);
    return 1;
    assert(lua_gettop(L) == 1);
  } else {

    /* else
     * return vl */
    lua_pushvalue(L, 1);
    return 1;
    assert(lua_gettop(L) == 1);
  }
  lua_settop(L, lc1024);
  assert(lua_gettop(L) == 1);
  return 0;
}

